const initialState = [
  {
    id: 1,
    name: 'canceled'
  },
  {
    id: 2,
    name: 'draft'
  },
  {
    id: 3,
    name: 'with pickup'
  },
  {
    id: 4,
    name: 'printed'
  }
]

function storeReducer(state = initialState, action) {
  return state;
}

export default storeReducer
